import React from 'react';

class Hello extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            hariu: 100,
            question:[]
        }
        this.handleClick = this.handleClick.bind(this);
    }
    componentDidMount() {
        fetch("http://localhost:3001/users")
          .then(response => response.json())
          .then(res => res.json())
          .then(data => {
            this.setState({hariu:20000000})
          })
          .catch(rejected => {
              console.log(rejected);
          });
      }
    handleClick() {
        document.getElementsByClassName("103")[0].style.color = 'red';
    }
    render(){
        return (
            <div>
                     <div className="103"><h1>{this.state.hariu}</h1></div>
                     <button onClick={()=> this.handleClick()}>sss</button>
            </div>

        );

    }
}

export default Hello;
